import React from 'react';
import './Cards.css';
import CardItem from './CardItem';
import { Container, Navbar } from 'react-bootstrap';
import { Link } from 'react-router-dom';

function Cards() {
  return (
    <>
        <nav class="Navbar">
          <div class="cards_container">
          <h1><b>Our Services</b></h1>
          <h5>Choose from our wide range of household services</h5>
          <body>
          <button class="tablink" herf="" onclick="openPage('All', this, 'green')" id="defaultOpen"><b>All</b><br/><h6>Services</h6></button> 
          <button class="tablink" onclick="openPage('Contact', this, 'blue')"><b>Clean</b><br/><h6>My Home</h6></button>
          <button class="tablink" onclick="openPage('Guard', this, 'orange')"><b>Guard</b><br/><h6>My Home</h6></button>

          <div id="All" class="tabcontent">
          <h3>News</h3>

          </div>

          <div id="Clean" class="tabcontent">
            <h3>Contact</h3>

          </div>

          <div id="Guard" class="tabcontent">
            <h3>About</h3>

          </div>
          </body>

          </div>
        </nav>

    </>
  );
}

export default Cards;
